function Split(s, delimiter)
	local index = 0
	local result = {}
	local line = {}

	for match in (s..delimiter):gmatch("(.-)"..delimiter) do
		if tonumber(match) ~= nil then
			match = tonumber(match)
		end
		if index == 0 or index % 3 ~= 0 then
			table.insert(line, match)
		else
			table.insert(result, line)
			line = {}
			table.insert(line, match)
		end
		index = index + 1
	end
	table.insert(result, line)
	return result
